/*Table structure for table `data_rule` */

DROP TABLE IF EXISTS `data_rule`;

CREATE TABLE `data_rule` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rule_name` varchar(255) NOT NULL DEFAULT '' COMMENT '规则名称',
  `type` varchar(20) DEFAULT 'list' COMMENT '数据展示[list列表group组态]',
  `remark` varchar(255) DEFAULT NULL COMMENT '规则说明',
  `realtime` varchar(20) NOT NULL DEFAULT 'show' COMMENT '实时数据[show显示hide隐藏]',
  `read` varchar(20) NOT NULL DEFAULT 'show' COMMENT '数据读写[show显示hide隐藏]',
  `history` varchar(20) NOT NULL DEFAULT 'show' COMMENT '历史数据[show显示hide隐藏]',
  `alarm` varchar(20) NOT NULL DEFAULT 'show' COMMENT '报警记录[show显示hide隐藏]',
  `push` varchar(20) NOT NULL DEFAULT '' COMMENT '消息推送',
  `fault` varchar(20) NOT NULL DEFAULT 'show' COMMENT '通讯故障检测[close关闭open开启]',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `times` int(11) NOT NULL DEFAULT '0' COMMENT '通讯故障滤波(次)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='数据规则';

