/*Table structure for table `msg_push` */

DROP TABLE IF EXISTS `msg_push`;

CREATE TABLE `msg_push` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '标题',
  `keyword` varchar(255) DEFAULT NULL COMMENT '关键字',
  `content` text COMMENT '内容',
  `username` varchar(255) DEFAULT '' COMMENT '作者',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `count` int(11) NOT NULL DEFAULT '0' COMMENT '点击量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='消息推送';

