/*Table structure for table `toilet_share` */

DROP TABLE IF EXISTS `toilet_share`;

CREATE TABLE `toilet_share` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `lng` varchar(11) NOT NULL DEFAULT '' COMMENT '经度',
  `lat` varchar(11) NOT NULL DEFAULT '' COMMENT '纬度',
  `type` varchar(3) NOT NULL DEFAULT '0' COMMENT '厕所类型：0真空1环卫2爱心3站台',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '厕所名称',
  `address` varchar(255) DEFAULT NULL COMMENT '厕所地址',
  `tel` varchar(12) DEFAULT NULL COMMENT '负责人电话',
  `time` int(11) DEFAULT NULL COMMENT '开放时间',
  `mentoilet` int(11) DEFAULT NULL COMMENT '男厕个数',
  `womentoilet` int(11) DEFAULT NULL COMMENT '女厕个数',
  `accessibletoilet` int(11) DEFAULT NULL COMMENT '无障碍厕所个数',
  `contactname` varchar(255) DEFAULT NULL COMMENT '联系人',
  `gcid` varchar(20) NOT NULL DEFAULT '' COMMENT '子站编号',
  `install` varchar(32) DEFAULT NULL COMMENT '公厕设施信息',
  `dtu_id` int(11) NOT NULL DEFAULT '0' COMMENT '设备编码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1170 DEFAULT CHARSET=utf8 COMMENT='共享厕所表';

